Game = function(map){
  this.miniMap = map
  this.board = new Board(this);
  this.player = new Player(this, 4,4);
  this.board.refreshTiles(map);
};

Tile = function(game, options, value){
  this.game = game;
  this.x = options.x
  this.y = options.y
  this.value = value
};

Board = function(game){
  this.game = game;
  this.tiles = [];
};


Player = function(game, x, y){
  this.game = game;
  this.x = x;
  this.y = y;
};

Player.prototype.changeX = function(num){
  this.x = num;
}
Player.prototype.changeY = function(num){
  this.y = num;
}

Player.prototype.move = function(direction){

  if (direction === 'up'   ) this.y--;
  if (direction === 'down' ) this.y++;
  if (direction === 'left' ) this.x--;
  if (direction === 'right') this.x++;

  this.changeX(this.x)
  this.changeY(this.y)

  this.game.board.refreshTiles(this.game.miniMap);
  return this;
};


